    return(
        <div>
            <img src="https://cataas.com/c" alt="A cat" width="500" height="600" loading="lazy"></img>
            <img src="https://cnet3.cbsistatic.com/img/zKiT35AfPlfRJvlHty6p4zmpCrw=/940x0/2020/05/01/7f0a951f-d9a2-4847-b962-b254b63842a2/img-4960.jpg" alt="A cat" width="50" height="60" type="image/webp" loading="lazy"></img>
        </div>
    );
}

export default CatPic;
